import React, { useRef, useEffect } from 'react'
import '../styles/App.css'
import { select, selectAll, entries } from 'd3'

function App() {
  const data = [10, 25, 50, 63, 91]
  const svgRef = useRef()
  useEffect(() => {
    const svg = select(svgRef.current)
    svg
      .selectAll("circle")
      .data(data)
      .join(
        entries => en
      )
  }, [])

  return <svg ref={svgRef} />
}

export default App
